  root: {
    flexGrow: 1,
  },
  navbar: {
      backgroundColor: 'transparent',
      boxShadow: 'none',
      padding: '0',
      maxWidth: 960,
      marginLeft: 'auto',
      marginRight: 'auto',
      paddingLeft: 'auto,'
  },
  button: {
    backgroundColor: 'transparent',
    boxShadow: 'none',
    marginLeft: 'auto',
    padding: '0',

  },
}));

